INSERT INTO `quotes` (`id`, `description`, `date_required`, `client_id`, `created_at`, `updated_at`) VALUES (2,NULL,NULL,320,'2019-08-02 13:26:47','2019-08-02 13:26:47'),(20004,'Looking for these jerseys for next years team. Would like to have our logo included. I\'ll have to find a pic.\r\n\r\nPlease contact by EMAIL ONLY.',NULL,344,'2019-08-06 15:04:21','2019-08-06 15:04:21'),(20005,'Our team loves the this orange mock jersey you have made with the Knigts logo, what would the cost be for 20 sets including socks?',NULL,348,'2019-08-06 18:05:14','2019-08-06 18:05:14'),(20006,'We would like the the front to say \"Marauders\" with the bird and crest from our logo on the left (under the wording. \n\nWe would like the back to have a number and name.\n\nThank you! I look forward to hearing from you.','August 21st, 2019',351,'2019-08-07 14:48:09','2019-08-07 14:48:09'),(20007,'We would like the Logo to be on the front and center \nthe name to be on the top above number and the number ont he back center \n\nI have attached 2 attachments of my logo one of the picture one of the logo being made from last years vendor. \n\nI would like it to say BOMB MOMS not Bomb mom The S needs to be there. \n\nALL JERSEYS ARE WOMEN\'S ADULT','SEPT 10, 2019',354,'2019-08-13 17:03:18','2019-08-13 17:03:18'),(20008,'I would like a visual of the logo on the crest of the jersey and also a visual of the logo with the matching socks(on the socks). I need these visuals ASAP as hockey season start soon and we need to make a decision with what we are going with.\n\nThank you','2019-08-15',355,'2019-08-14 00:06:21','2019-08-14 00:06:21'),(20009,'Would like to have a tiger/lion claw logo on the sleeve.','August 14',356,'2019-08-14 05:14:29','2019-08-14 05:14:29'),(20010,'strangerswingslogo (attached) placed on front center of jersey, player name and number on the back for 11 males and 4 females for a softball team. Font used for logo also attached (Benguiat Bold). Looking for jerseys as fast as possible, will be used for company event.','As soon as possible',359,'2019-08-15 04:43:53','2019-08-15 04:43:53'),(20011,'Artwork: front-center; logo color switching between color 1 and 2 depending on the background. E.g. Cardianal logo when base is Powder, vice versa. \n\nNumbers and name on the back: same as above, flip flop of colors.\n\nThank you!','ASAP, preferably by August 16th!',360,'2019-08-15 19:14:11','2019-08-15 19:14:11'),(20012,'We would only like the number and names on the back NO NUMBER ON FRONT please \n\nThe logo only on the front \nNumber and Last names on the back \n\nCan the logo be all in the colors of black and white letters back bomb into a pink black and white tnt exploding volleyball on the top \n\nIf not i would prefer black and white logo but if you can interpret pink in the logo somewhere that would be awesome.','September 10,2019',361,'2019-08-16 16:24:00','2019-08-16 16:24:00'),(20013,'Centered logo and on the left shoulder if possible. \n\n5 small\n6 medium\n8 large\n2 xl\n\nI have logos in eps/.ai.pdf if needed.',NULL,362,'2019-08-16 18:05:04','2019-08-16 18:05:04'),(20014,'Centered logo attached and one on the right arm.\n\nwe need 5 small 6 medium 8 large and 2 xl.','next summer',363,'2019-08-16 18:07:58','2019-08-16 18:07:58'),(20015,'Our team name is Balls Deep and we would just like the writing on the front like most other teams . We do have a sponsor and we would like names on the back. Looking for pricing .','Aug 16 2019',364,'2019-08-16 18:42:00','2019-08-16 18:42:00'),(20016,'Hi. I’m looking for the 90s style Blues jersey. Custom logo and shoulder patch. Not sure if I want names or not. But numbers for sure. What would be an estimated cost?\r\n\r\nThanks.',NULL,365,'2019-08-17 16:21:35','2019-08-17 16:21:35'),(20017,'Hello,\r\n\r\nI saw this concept Raptors uniform and was wondering if you can replicate it?\r\n\r\nWe would need at least 7 uniforms.\r\nHow much would it be for just the jerseys?\r\n\r\nWe would also need a number o